import GridColumnSections from '../../GridColumnSections';



export default class FirstSemesterCourses extends GridColumnSections {
  linkMap = new Map([
      ['American Institute of Aeronautics and Astronautics (AIAA)','https://dukeasce.wordpress.com/']
  ])

  createLinks(){
      var links = [];
      var index = [];
      for (let key of this.sectionMap.keys()){
        links[index] = (
            <a src={this.sectionMap.get(key)}>{key}</a>
        )
        index+=1;
      }
      return links;
  }
  sectionMap = new Map([
      ['','']
    ])

    constructor(){
      super()
      this.setMap(this.sectionMap);
      this.setColumnsPerRow(1);
    }


}
